  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Tallahatchie
  National Wildlife Refuge and Dahomey National Wildlife Refuge outlines Refuge accomplishments
  during the 1996 calendar year.  The report begins with a summary of the year's highlights
  and weather conditions. Land acquisition is covered. The report includes a planning
  section which discusses management plan, and research and investigations, compliance
  with environmental and cultural resource mandates. Refuge administration is outlined;
  information about personnel, funding, and safety is given. Habitat management is
  also covered; subjects include wetlands, forests, fire management, WPA easements,
  and private lands. The wildlife section of the report discusses wildlife diversity,
  endangered and threatened species, and waterfowl. The public uses of the Refuge
  described in this report include trapping and law enforcement. The equipment and
  facilities section of the report provides information about new construction and
  equipment replacement\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
